  useEffect(() => {
    const data = JSON.parse(sessionStorage.getItem("isAuthenticated"));
    console.log(data)
  }, []);

  return (
    <div className="edit-profile-page">
      {console.log(user)}
      <div className="edit-profile-details">
        <img src="https://bootdey.com/img/Content/avatar/avatar7.png" />

        <p>
          <b>Full Name : Abhishek Kumar</b>
        </p>
        <hr />
        <p>
          <b>Address : Rengali,Sambalpur</b>
        </p>
        <hr />
        <p>
          <b>Email : AbhishekKumar8162@gmail.com</b>
        </p>
        <hr />
        <p>
          <b>Phone : 9348180912</b>
        </p>
        <hr />
        <p>
          <b>Post : Software Engineer</b>
        </p>
        <hr />
        <p>
          <b>College : GCE Keonjhar</b>
        </p>
        <hr />
      </div>
    </div>
  );
}

export default EditProfile;
